import React , { Component } from 'react';
import App from './App.js';
import robots from './robots.js';

const cards = robots.map(( user, i) => {
    return (
      <App 
      id={robots[i].id} 
      name={robots[i].name} 
      email={robots[i].email}
      />);
  })

  class Web extends Component {
    render(){
        return(
            <div>
            <h1>Robo Friends</h1>
            <searchBox />
            {cards}
          </div>
        );
    }

}

export default Web;
